window.bookSummaryJSON = "<p><b>Selene cares about three things in life.</b></p> <p>Her prestigious position as Lieutenant of the Guard that very few of the elite at Court feel she deserves. Her beloved sister and niece: humiliating reminders of her humble origins. Her penchant for rare and expensive diningâ€”a status symbol and marker of the success she's attained.</p> <p>Austin only cares about one thing in life: Music.</p> <p>But Austin's rockstar dreams never came true, and the bottom of the bottle isn't giving him the answers he's searching for. Maybe, just maybe, a prickly Shade with a secret wild side will.</p> <p>Gula <i>is the third book in the Shades of Sin series, featuring humans and their not-quite-so-human partners. For mature listeners.</i></p>"; 
